INSERT INTO public.contract_templates (id, name, description, country_code, language_code, category, status, placeholders, is_default, sort_order, created_by, created_at, updated_at, content_html) VALUES ('385cb067-d5d5-4708-b439-0c3abeea8f7f', 'SK zmluva o odbere', '', 'SK', 'sk', 'collection', 'draft', '{"loadedFromCategory":true,"loadedCategoryId":6,"sourceDocxPath":"uploads/contract-pdfs/template-ai-1767872898764.docx","extractedFields":["contract.number","customer.fullName","father.fullName","customer.permanentAddress","customer.birthDate","customer.date"],"placeholderMappings":{"{{contract.number}}":"contract.number","{{customer.fullName}}":"customer.fullName","{{customer.permanentAddress}}":"customer.permanentAddress","{{customer.birthDate}}":"customer.birthDate","{{father.fullName}}":"father.fullName","{{father.permanentAddress}}":"father.permanentAddress","{{customer.date}}":"customer.date"}}', false, 0, '67467ce3-7a44-4f67-a3d3-6a251e2991e5', '2026-01-08 11:57:01.201628', '2026-01-08 11:57:01.201628', '<p><a id="br1"></a> </p><p>Zmluva o odbere</p><p>číslo zmluvy <span class="placeholder" style="background: #fff3cd; padding: 2px 4px; border-radius: 3px; font-weight: bold; color: #856404;">{{contract.number}}</span>,</p><p>uzavretá podľa § 262 ods. 1 a § 269 ods. 2 zákona č. 513/1991 Zb. Obchodný zákonník v znení neskorších predpisov (ďalej len„Obchodný zákonník“)</p><p>medzi</p><p>a</p><p>Cord Blood Center AG</p><p>pani: <span class="placeholder" style="background: #fff3cd; padding: 2px 4px; border-radius: 3px; font-weight: bold; color: #856404;">{{customer.fullName}}</span></p><p><span class="placeholder" style="background: #fff3cd; padding: 2px 4px; border-radius: 3px; font-weight: bold; color: #856404;">{{father.fullName}}</span>. (ďalej len„RODIČKA“)</p><p>trvale bytom: <span class="placeholder" style="background: #fff3cd; padding: 2px 4px; border-radius: 3px; font-weight: bold; color: #856404;">{{customer.permanentAddress}}</span></p><p>so sídlom: Bodenhof 4, 6014 Luzern, Švajčiarska konfederácia</p><p>Identiﬁkačné číslo: CHE-178.669.230</p><p>Daňové Identiﬁkačné číslo: 2014927</p><p>Identiﬁkačné číslo DPH: CHE-178.669.230 MWST</p><p>Zastúpená na základe plnomocenstva: Ján Šidlík, MBA,</p><p>splnomocnenec</p><p>.</p><p><span class="placeholder" style="background: #fff3cd; padding: 2px 4px; border-radius: 3px; font-weight: bold; color: #856404;">{{customer.birthDate}}</span>...................................</p><p>korešpondenčná adresa (ak je iná ako miesto trvalého pobytu):</p><p><span class="placeholder" style="background: #fff3cd; padding: 2px 4px; border-radius: 3px; font-weight: bold; color: #856404;">{{customer.date}}</span>....................</p><p>.</p><p>dátum narodenia: ..................................................................................................</p><p>a</p><p>IBAN: SK44 1111 0000 0013 8851 9013</p><p>SWIFT: UNCRSKBX</p><p>pán: ........................................................................................... (ďalej len„otec“)</p><p>trvale bytom: ...........................................................................................................</p><p>......................................................................................................................................</p><p>(ďalej ako spoločnosť„CBC AG“ v príslušnom ženskom rode)</p><p>(ďalej len„Zmluva“) takto:</p><p>Článok I - Preambula</p><p>sa zaväzuje zaplatiť dohodnutú odplatu podľa tejto Zmluvy. Zabez-</p><p>pečenie skladovania transplantátu bude medzi zmluvnými stranami</p><p>upravené prostredníctvom osobitnej Zmluvy o skladovaní.</p><p>I.1</p><p>I.2</p><p>Zmluvné strany sa dohodli, že túto Zmluvu uzatvárajú podľa § 262</p><p>ods. 1 Obchodného zákonníka a v zmysle § 269 ods. 2 Obchodného</p><p>zákonníka.</p><p>III.2</p><p>Transplantát môže byť použitý na autológnu transplantáciu. Trans-</p><p>plantát môže byť pripravený spracovaním z pupočníkovej krvi (ďalej</p><p>ako „Produkt Štandard“) alebo z pupočníkovej a placentárnej krvi</p><p>alebo iba z placentárnej krvi (ďalej ako „Produkt Prémium“) alebo</p><p>z pupočníkovej krvi a tkaniva pupočníka (ďalej ako „Produkt Štan-</p><p>dard + tkanivo pupočníka“) alebo z pupočníkovej a placentárnej krvi</p><p>alebo iba z placentárnej krvi a tkaniva pupočníka (ďalej ako„Produkt</p><p>Prémium + tkanivo pupočníka“) alebo z pupočníkovej a placentár-</p><p>nej krvi alebo iba z placentárnej krvi a tkaniva pupočníka a tkaniva</p><p>placenty (ďalej ako „Produkt Prémium + tkanivo pupočníka + tka-</p><p>nivo placenty“) alebo iba z tkaniva pupočníka (ďalej ako „Produkt</p><p>Tkanivo pupočníka“).</p><p>Zmluvné strany vyhlasujú, že túto Zmluvu uzatvárajú slobodne, váž-</p><p>ne a bez omylu, že sú spôsobilé na právne úkony v plnom rozsahu,</p><p>obsah Zmluvy im je dobre známy v celom jeho rozsahu a Zmluvu</p><p>neuzatvárajú v tiesni alebo za nápadne nevýhodných podmienok.</p><p>I.3</p><p>CBC AG je obchodná spoločnosť založená a existujúca podľa práva</p><p>Švajčiarskej konfederácie, ktorá zabezpečuje niektoré činnosti regis-</p><p>tra pupočníkovej a placentárnej krvi, tkaniva pupočníka a placen-</p><p>ty, pričom predmetná činnosť zahŕňa najmä zabezpečenie odberu</p><p>krvotvorných kmeňových buniek z pupočníkovej a placentárnej</p><p>krvi a tkaniva pupočníka a placenty zdravotníckym zariadením pri</p><p>pôrode dieťaťa RODIČKY a ich následné spracovanie na autológnu</p><p>transplantáciu.</p><p>Článok IV - Transplantát</p><p>I.4</p><p>CBC AG so súhlasom RODIČKY zabezpečuje činnosti podľa bodu</p><p>I.3 a plní si svoje povinnosti v súlade s ustanovením bodu VI.1 tejto</p><p>Zmluvy prostredníctvom na takúto činnosť riadne licencovaného</p><p>subjektu na území Slovenskej republiky (Slovenský register placen-</p><p>tárnych krvotvorných buniek, Dúbravská cesta 9, 841 04 Bratislava,</p><p>IČO: 31771165 (ďalej len „S.R.P.K.B.“), resp. iným riadne licencova-</p><p>ným subjektom v Slovenskej republike). Pre vylúčenie akýchkoľvek</p><p>pochybností, sa zmluvné strany dohodli, že plnenie akýchkoľvek</p><p>povinností, záväzkov a práv CBC AG podľa tejto Zmluvy, ktoré by</p><p>spočívalo vo vykonávaní akejkoľvek činnosti, podliehajúcej oso-</p><p>bitnej regulácii poskytovania zdravotnej starostlivosti v Slovenskej</p><p>IV.1</p><p>CBC AG je povinná zabezpečiť spracovanie krvi a/alebo tkaniva na</p><p>transplantát alebo časti transplantátu RODIČKE v stave použiteľnom</p><p>na účely autológnej transplantácie, pokiaľ nie je v Zmluve uvedené</p><p>inak alebo pokiaľ sa zmluvné strany nedohodnú inak. RODIČKA be-</p><p>rie na vedomie, že transplantáciu do tela príjemcu je možné usku-</p><p>točniť výlučne len, ak to zdravotný stav príjemcu dovoľuje podľa po-</p><p>súdenia ošetrujúcim, prípadne iným príslušným lekárom a príjemca,</p><p>resp. jeho zákonný zástupca pred transplantáciou riadne poskytol</p><p>informovaný súhlas po jeho predchádzajúcom poučení, pričom vý-</p><p>ber príjemcu sa riadi výlučne medicínskym hľadiskom.</p><p>republike, bude tieto CBC AG vždy zabezpečovať výlučne prostred- IV.2</p><p>níctvom riadne licencovaného subjektu v Slovenskej republike.</p><p>Transplantát sa v zmysle Zmluvy považuje za použiteľný na účely</p><p>autológnej transplantácie, ak:</p><p>a) odobratá krv a/alebo tkanivo je/sú spracovaná/é v súlade s plat-</p><p>nou právnou úpravou a odbornými postupmi,</p><p>Článok II - Predmet Zmluvy</p><p>II.1</p><p>Predmetom záväzku CBC AG podľa tejto Zmluvy pre RODIČKU je</p><p>zabezpečenie odberu pupočníkovej a/alebo placentárnej krvi (ďa-</p><p>lej len „krv“) a/alebo tkaniva pupočníka a/alebo placenty (ďalej len</p><p>b) transplantát je v momente jeho vydania riadne vyšetrený a boli</p><p>vykonané požadované testy v súlade s platnou právnou úpravou,</p><p>c)</p><p>je stanovený počet jadrových buniek v krvi.</p><p>„</p><p>tkanivo“) zdravotníckym zariadením pri pôrode dieťaťa RODIČKY,</p><p>IV.3</p><p>Po spracovaní krvi a/alebo tkaniva bude S.R.P.K.B. písomne infor-</p><p>movať RODIČKU o použiteľnosti transplantátu, ako aj o výsledkoch</p><p>spracovania krvi a/alebo tkaniva (ďalej len „Výsledky spracovania“).</p><p>Na základe Výsledkov spracovania má RODIČKA právo rozhodnúť sa,</p><p>že nevyužije svoje právo na akceptáciu pripraveného transplantátu,</p><p>a teda pripravený transplantát odmietne a tým ho zároveň daruje</p><p>S.R.P.K.B. na vedecké a medicínske účely alebo na zabezpečenie jeho</p><p>likvidácie v súlade s príslušnými právnymi predpismi, s čím RODIČKA</p><p>ich následné spracovanie (ďalej spoločne len “transplantát“), ako aj</p><p>na základe záujmu RODIČKY zabezpečenie následného skladovania</p><p>transplantátu za podmienok nižšie uvedených v Zmluve.</p><p>Článok III – Zabezpečenie činností</p><p>III.1</p><p>RODIČKA podpisom Zmluvy vyjadruje svoj výslovný súhlas so za-</p><p>bezpečením činností CBC AG v súlade s bodom II.1 Zmluvy, pričom</p><p>1</p><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><p><a id="br2"></a> </p><p>výslovne súhlasí.</p><p>renia krvi a/alebo tkaniva, dôvodov zisťovania anamnézy RODIČKY</p><p>a údajov o jej predchádzajúcich liečeniach, ako aj o iných informá-</p><p>ciách a údajoch vyžadovaných podľa platnej právnej úpravy,</p><p>IV.4</p><p>IV.5</p><p>V prípade, ak sa RODIČKA rozhodne pre odmietnutie a darovanie</p><p>pripraveného transplantátu, je povinná túto skutočnosť bezodklad-</p><p>ne, najneskôr do 14 kalendárnych dní odo dňa doručenia Výsledkov</p><p>spracovania, písomne oznámiť CBC AG, ak v Zmluve nie je uvedené</p><p>inak. Za moment akceptácie sa pritom považuje okamih zaplatenia</p><p>celej odplaty v zmysle bodu V.1 tejto Zmluvy a následné zabezpeče-</p><p>nie transplantátu na účely jeho skladovania podľa osobitnej Zmluvy</p><p>o skladovaní uzavretej medzi zmluvnými stranami alebo iným Sub-</p><p>jektom (tak ako je deﬁnovaný v bode IV.9 nižšie) v súlade s a za pod-</p><p>mienok tejto Zmluvy.</p><p>c) sa zaväzuje vrátiť RODIČKE v celom rozsahu už poskytnuté ﬁnanč-</p><p>né plnenie v súlade s bodom V.1 Zmluvy v prípade, že sa RODIČKA</p><p>rozhodne odstúpiť od zamýšľaného odberu v súlade s bodom IV.5</p><p>písm. g) alebo písm. i) tejto Zmluvy, a to do 28 kalendárnych dní od</p><p>doručenia písomného odstúpenia, ktoré musí obsahovať číslo účtu</p><p>RODIČKY; v prípade, ak RODIČKA odstupuje iba od časti Zmluvy,</p><p>RODIČKE bude vrátená iba tá časť ﬁnančného plnenia, ktorá zodpo-</p><p>vedá predmetnej časti Zmluvy, ktorá zaniká odstúpením RODIČKY,</p><p>V súvislosti s odberom a spracovaním krvi a/alebo tkaniva na trans-</p><p>plantát RODIČKA:</p><p>a) sa zaväzuje poskytnúť CBC AG a S.R.P.K.B. požadovanú súčinnosť</p><p>d) je povinná zabezpečiť realizáciu vyšetrení a testov podľa platnej</p><p>právnej úpravy najmä tie, ktoré sú uvedené v bode IV.2 písm. b)</p><p>a písm. c) Zmluvy. V prípade záujmu RODIČKY o ďalšie vyšetrenia</p><p>alebo testy sa zmluvné strany dohodnú na podmienkach, za akých</p><p>by tieto mohli byť zabezpečené.</p><p>potrebnú na riadne plnenie Zmluvy,</p><p>b) sa zaväzuje pravdivo vyplniť dokumenty a formuláre uvedené</p><p>v bode VII.8 Zmluvy, pravdivo v pôrodnici vyplniť a poskytnúť infor-</p><p>movaný súhlas pred odberom krvi a/alebo tkaniva,</p><p>c) sa zaväzuje absolvovať všetky lekárske vyšetrenia podľa požia-</p><p>dania S.R.P.K.B. a/alebo lekárov a o ich výsledkoch prostredníctvom</p><p>svojho ošetrujúceho lekára alebo gynekológa informovať S.R.P.K.B.,</p><p>d) sa zaväzuje za podmienok, v lehotách a spôsobom uvedeným</p><p>v tejto Zmluve, riadne a včas zaplatiť dohodnutú odplatu, prípadne</p><p>iné poplatky CBC AG,</p><p>e) na základe dobrovoľného rozhodnutia môže poskytnúť S.R.P.K.B.</p><p>pravdivé informácie o zdravotnom stave dieťaťa po jeho prvom roku</p><p>života a doloží to Návratkou o zdravotnom stave dieťaťa podpísa-</p><p>nou ambulantným pediatrom dieťaťa (ďalej len„Návratka“), v ktorej</p><p>súčasne udelí výslovný súhlas so spracúvaním osobných údajov</p><p>dieťaťa uvedených v Návratke; údaje z Návratky slúžia na získavanie</p><p>ďalších relevantných údajov k transplantátu, ktoré umožnia násled-</p><p>né zhodnotenie parametrov pre prípadné budúce použitie trans-</p><p>plantátu,</p><p>f) má právo požadovať od CBC AG informácie súvisiace s plnením</p><p>Zmluvy, pričom CBC AG je oprávnená si splniť svoju informačnú po-</p><p>vinnosť prostredníctvom S.R.P.K.B., resp. iného licencovaného sub-</p><p>jektu, ktorý oprávnene disponuje žiadanými informáciami,</p><p>IV.8</p><p>V prípade, ak RODIČKA v súlade s bodom IV.4 tejto Zmluvy najneskôr</p><p>do 14 kalendárnych dní odo dňa doručenia Výsledkov spracovania</p><p>oznámi CBC AG, že odmieta transplantát, dohodli sa zmluvné strany,</p><p>že RODIČKA transplantát darováva S.R.P.K.B. na vedecké a medicín-</p><p>ske účely podľa tejto Zmluvy, resp. na zabezpečenie jeho likvidácie</p><p>v súlade s príslušnými právnymi predpismi, s čím RODIČKA výslovne</p><p>súhlasí. V takomto prípade sa CBC AG zaväzuje vrátiť RODIČKE v ce-</p><p>lom rozsahu už poskytnuté ﬁnančné plnenie v súlade s bodom V.1</p><p>Zmluvy do 28 kalendárnych dní odo dňa, kedy bude CBC AG toto</p><p>písomné oznámenie doručené spolu s číslom účtu, na ktoré má byť</p><p>ﬁnančné plnenie vrátené. RODIČKA berie na vedomie, že CBC AG sa</p><p>nedostane do omeškania s vrátením už poskytnutého ﬁnančného</p><p>plnenia v prípade neoznámenia čísla účtu RODIČKOU.</p><p>IV.9</p><p>Bezodkladne po uhradení celej odplaty v zmysle bodu V.1 Zmluvy,</p><p>CBC AG zabezpečí skladovanie transplantátu v súlade s podmien-</p><p>kami podľa osobitnej Zmluvy o skladovaní. V prípade, ak RODIČKA</p><p>zvolila možnosť úhrady odplaty podľa bodu V.1 Zmluvy o odbere</p><p>formou postupných mesačných splátok, CBC AG zabezpečí sklado-</p><p>vanie transplantátu momentom uhradenia zálohovej platby a prvej</p><p>mesačnej splátky odplaty podľa bodu V.1 tejto Zmluvy. V prípade,</p><p>ak si bude RODIČKA želať skladovanie prostredníctvom tretej osoby,</p><p>CBC AG zabezpečí umožniť, aby transplantát prevzalo RODIČKOU</p><p>písomne určené a na takúto činnosť riadne licencované zdravotníc-</p><p>ke zariadenie (ďalej len„Subjekt“). Transplantát však bude Subjektu</p><p>umožnené prevziať iba za podmienky, že Subjekt bude odborne</p><p>a technicky spôsobilý na prevzatie transplantátu pri dodržaní prís-</p><p>lušných právnych predpisov. CBC AG, prípadne priamo S.R.P.K.B, je</p><p>oprávnená od Subjektu požadovať preukázanie odbornej spôsobi-</p><p>losti (napr. predložením príslušných povolení, súhlasov a licencií)</p><p>pred zabezpečením umožnenia prevzatia transplantátu. Ak sa RO-</p><p>DIČKA a CBC AG písomne nedohodnú inak, RODIČKA udeľuje sú-</p><p>hlas, aby CBC AG v mene RODIČKY zabezpečila umožnenie prevza-</p><p>tia transplantátu Subjektom na skladovanie, a to prostredníctvom</p><p>S.R.P.K.B. Transplantát bude prevzatý v mieste určenom dohodou</p><p>zmluvných strán. V prípade, ak k dohode nedôjde, miesto prevzatia</p><p>určí CBC AG, prípadne priamo S.R.P.K.B. Všetky náklady na zabezpe-</p><p>čenie umožnenia prevzatia transplantátu Subjektom na žiadosť RO-</p><p>DIČKY primerane vynaložené zo strany CBC AG znáša RODIČKA. Pri</p><p>prevzatí uskladneného transplantátu Subjektom podpíše Subjekt,</p><p>S.R.P.K.B. a RODIČKA protokol o prevzatí transplantátu, v ktorom</p><p>opíšu stav transplantátu pri jeho prevzatí a uvedú dátum prevzatia</p><p>transplantátu. Od momentu prevzatia uskladneného transplantátu</p><p>Subjektom, CBC AG nenesie žiadnu zodpovednosť za stav a použi-</p><p>teľnosť transplantátu. Za primerane vynaložené, sa rozumejú predo-</p><p>všetkým, nie však výhradne, náklady súvisiace s vyšetrením trans-</p><p>plantátu prostredníctvom S.R.P.K.B. (napr. konﬁrmačná typizácia,</p><p>mikrobiologické a serologické testy, CD34), jeho transportom a prí-</p><p>slušnými administratívnymi úkonmi. CBC AG zabezpečí, aby údaje</p><p>z vyšetrenia transplantátu poskytol S.R.P.K.B. priamo Subjektu.</p><p>g) má právo odstúpiť od zamýšľaného odberu krvi a/alebo tkaniva</p><p>bez akýchkoľvek sankcií pred vykonaním odberu,</p><p>h) má právo sa do 14 kalendárnych dní odo dňa doručeniaVýsledkov</p><p>spracovania rozhodnúť, či využije právo na akceptáciu transplantátu</p><p>alebo ho odmietne a daruje S.R.P.K.B. na vedecké a medicínske účely</p><p>alebo na zabezpečenie jeho likvidácie v súlade s príslušnými práv-</p><p>nymi predpismi; v prípade odmietnutia je RODIČKA povinná zaslať</p><p>CBC AG doporučený list.</p><p>i) v prípade mikrobiologickej kontaminácie transplantátu má právo</p><p>písomne odstúpiť od celej Zmluvy alebo od časti Zmluvy týkajúcej</p><p>sa kontaminovaného transplantátu, a to do 8 týždňov odo dňa do-</p><p>ručenia Výsledkov spracovania, ak v Zmluve nie je uvedené inak.</p><p>V prípade, ak v čase odstúpenia od Zmluvy alebo jej časti došlo</p><p>k podpísaniu Zmluvy o skladovaní zmluvnými stranami, dňom účin-</p><p>nosti odstúpenia od Zmluvy alebo jej časti zároveň zaniká Zmluva</p><p>o skladovaní , resp. jej časť týkajúca sa kontaminovaného transplan-</p><p>tátu, a to na základe výslovnej dohody zmluvných strán. V takomto</p><p>prípade sa kontaminovaný transplantát, ktorého sa odstúpenie tý-</p><p>kalo, bude považovať za darovaný S.R.P.K.B. RODIČKOU na vedecké</p><p>a medicínske účely, resp. na zabezpečenie jeho likvidácie v súlade</p><p>s príslušnými právnymi predpismi, a to okamihom odstúpenia, s čím</p><p>RODIČKA výslovne súhlasí. Zmluvné strany si zároveň vysporiadajú</p><p>vzájomné práva a povinnosti vyplývajúce zo Zmluvy o skladovaní,</p><p>ak táto bola uzatvorená.</p><p>IV.6</p><p>IV.7</p><p>Povinnosti podľa bodu IV.5 písm. a), b) a d) Zmluvy sa v plnom roz-</p><p>sahu vzťahujú aj na Otca, ktorý podpisom Zmluvy s nimi vyjadruje</p><p>výslovný súhlas a zaväzuje sa ich dodržiavať. Ostatné práva a povin-</p><p>nosti podľa tejto Zmluvy vykonáva RODIČKA v súlade s ustanove-</p><p>ním bodu VII.11 Zmluvy.</p><p>Článok V - Odplata</p><p>V.1</p><p>Za zabezpečenie odberu a spracovania krvi a/alebo tkaniva na trans-</p><p>plantát pre RODIČKU, prináleží CBC AG odplata. Zmluvné strany sa</p><p>dohodli, že RODIČKA a Otec sú solidárne (spoločne a nerozdielne)</p><p>povinní dohodnutú odplatu CBC AG zaplatiť včas, pokiaľ v Zmluve</p><p>nie je dohodnuté inak. Zmluvné strany sa dohodli na nasledovnej</p><p>odplate podľa typu produktu:</p><p>V súvislosti s odberom a spracovaním krvi a/alebo tkaniva na trans-</p><p>plantát CBC AG:</p><p>a) sa zaväzuje plniť predmet Zmluvy s vynaložením odbornej sta-</p><p>rostlivosti,</p><p>b) pred odberom zabezpečí vysvetlenie významu a dôvodov vyšet-</p><p>2</p><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><p><a id="br3"></a> </p><p>PRE ZMLUVNÉ STRANY JE ZÁVÄZNÁ MOŽNOSŤ OZNAČENÁ KRÍŽIKOM:</p><p>záujem o transplantát a tento darováva S.R.P.K.B. na vedecké a me-</p><p>dicínske účely, resp. na zabezpečenie jeho likvidácie v súlade s prí-</p><p>slušnými právnymi predpismi, s čím RODIČKA výslovne súhlasí. Za</p><p>písomnú upomienku v zmysle predchádzajúcej vety sa považuje aj</p><p>SMS správa, resp. e-mailová správa odoslaná na telefónne číslo, resp.</p><p>e-mailovú adresu uvedenú RODIČKOU v Dotazníku pre rodičku. V ta-</p><p>kom prípade je S.R.P.K.B. oprávnený použiť transplantát na vedecké</p><p>a medicínske účely alebo zabezpečiť jeho likvidáciu v súlade s prís-</p><p>lušnými právnymi predpismi, s čím RODIČKA výslovne súhlasí.</p><p>VÝŠKA</p><p>ZOSTÁVAJÚCEJ</p><p>PLATBY*</p><p>CELKOVÁ POČET ZÁLOHOVÁ</p><p>TYP PRODUKTU</p><p>Štandard</p><p>SUMA</p><p>PLATIEB</p><p>PLATBA</p><p>150 €</p><p>150 €</p><p>150 €</p><p>150 €</p><p>0 €</p><p>590 €</p><p>2</p><p>2</p><p>2</p><p>2</p><p>1</p><p>440 €</p><p>640 €</p><p>640 €</p><p>840 €</p><p>300 €</p><p>Štandard + tkanivo</p><p>pupočníka</p><p>7</p><p>90 €</p><p>Prémium</p><p>790 €</p><p>V.3</p><p>RODIČKA a Otec sú povinní spoločne a nerozdielne uhradiť odpla-</p><p>tu CBC AG na bankový účet uvedený v záhlaví Zmluvy. V prípade</p><p>zmeny bankového spojenia oznámi CBC AG túto skutočnosť bezod-</p><p>kladne RODIČKE a RODIČKA a Otec sú povinní odo dňa oznámenia</p><p>používať v platobnom styku výlučne nové bankové účty CBC AG.</p><p>Prémium + tkanivo</p><p>pupočníka</p><p>9</p><p>90 €</p><p>00 €</p><p>Tkanivo</p><p>pupočníka**</p><p>3</p><p>V.4</p><p>V.5</p><p>Odplata sa považuje za zaplatenú dňom jej riadneho pripísania na</p><p>bankový účet CBC AG.</p><p>Prémium + tkanivo</p><p>pupočníka + tkanivo</p><p>placenty</p><p>1 490 €</p><p>2</p><p>150 €</p><p>1 340 €</p><p>V prípade, ak RODIČKA na základe Výsledkov spracovania, ktoré pre-</p><p>ukázali mikrobiologickú kontamináciu transplantátu, neodstúpi od</p><p>Zmluvy alebo jej časti v súlade s bodom IV.5 i) Zmluvy, ale písomne</p><p>oznámi do 8 týždňov odo dňa doručenia Výsledkov spracovania,</p><p>že má záujem o zabezpečenie skladovania takéhoto transplantátu,</p><p>a ak v tomto čase došlo zmluvnými stranami k podpisu Zmluvy</p><p>o skladovaní, táto nezaniká, zmluvné strany sa však dohodli, že CBC</p><p>AG má vo vzťahu ku kontaminovanej časti transplantátu nárok len</p><p>na odplatu podľa tejto Zmluvy v sume 1 €. V prípade, ak došlo k za-</p><p>plateniu odplaty alebo jej časti CBC AG za kontaminovaný transplan-</p><p>tát, CBC AG sa zaväzuje vrátiť RODIČKE zaplatenú odplatu alebo jej</p><p>časť, zníženú o sumu 1 €. Nárok CBC AG na zaplatenie poplatku za</p><p>zabezpečenie skladovania transplantátu podľa osobitnej Zmluvy</p><p>o skladovaní týmto nie je dotknutý.</p><p>*</p><p>*</p><p>Po odbere a odbržaní Výsledkov spracovania.</p><p>* Odplata CBC AG za zabezpečenie odberu Tkaniva pupočníka pri</p><p>kontaminácii časti odberu, pokiaľ sa zmluvné strany nedohodli inak</p><p>Mám záujem o postupné mesačné platby formou splátok bez</p><p>navýšenia.</p><p>Zmluvné strany sa dohodli na nasledovnom postupe úhrady odpla-</p><p>ty podľa bodu V.1 Zmluvy:</p><p>-</p><p>zálohová platba v sume 150 € je splatná do 14 kalendárnych dní</p><p>odo dňa vystavenia zálohovej faktúry,</p><p>zostatok odplaty po odpočítaní zaplatenej zálohovej platby je</p><p>-</p><p>V.6</p><p>V prípade, že RODIČKA a Otec po splnení podmienok určených</p><p>právnymi predpismi výslovne požiadajú CBC AG o zabezpečenie</p><p>likvidácie transplantátu z iných dôvodov ako sú uvedené v bode</p><p>IV.5 i) Zmluvy alebo bez udania dôvodu po uplynutí lehoty uve-</p><p>denej v bode IV.5 h) Zmluvy, sú RODIČKA a Otec povinní spoločne</p><p>a nerozdielne uhradiť poplatok za likvidáciu vo výške 200 €. Popla-</p><p>tok za likvidáciu bude uhradený na základe vystavenej faktúry CBC</p><p>AG. Faktúra bude vystavená a RODIČKE zaslaná do 14 kalendárnych</p><p>dní odo dňa doručenia písomnej žiadosti RODIČKY o zabezpečenie</p><p>likvidácie transplantátu. Likvidácia transplantátu môže byť podľa</p><p>rozhodnutia CBC AG vykonaná až po úplnom uhradení poplatku za</p><p>likvidáciu a po splnení podmienok určených právnymi predpismi.</p><p>splatný do 14 kalendárnych dní odo dňa vystavenia faktúry (vysta-</p><p>vená do 10 dní odo dňa doručenia Výsledkov spracovania),</p><p>-</p><p>v prípade, ak si RODIČKA zvolila možnosť platby formou postup-</p><p>ných mesačných splátok, tieto budú rozdelené na jednorazovú zálo-</p><p>hovú platbu v sume 150 € a následné rovnaké mesačné platby, ma-</p><p>ximálne v počte 10. Podmienky platby budú upravené splátkovým</p><p>kalendárom medzi RODIČKOU a CBC AG, ktorý sa stane súčasťou</p><p>tejto Zmluvy.</p><p>RODIČKA a CBC AG sa dohodli, že pred vykonaním samotného od-</p><p>beru krvi a/alebo tkaniva vykoná odoberajúci pracovník/zdravotníc-</p><p>ky pracovník overenie a potvrdenie požadovaného typu produktu</p><p>podľa bodu III.2 vyššie, a to formou vyznačenia rozhodnutia RODIČ-</p><p>KY na sprievodnej dokumentácii k odobratej krvi a/alebo tkanivu,</p><p>ktorú odoberajúci pracovník/zdravotnícky pracovník podpíše a ná-</p><p>sledne odovzdá S.R.P.K.B. pre účely spracovania krvi a/alebo tkaniva</p><p>na transplantát. S.R.P.K.B. po doručení sprievodnej dokumentácie</p><p>informuje CBC AG o tom, aký produkt bol overený a potvrdený zo</p><p>strany RODIČKY. Zmluvné strany sa dohodli, že pre CBC AG je záväz-</p><p>ný typ produktu (rozsah odberu) overený a potvrdený RODIČKOU</p><p>podľa predchádzajúcej vety. V prípade, ak by však podľa Výsledkov</p><p>spracovania nebolo možné vzhľadom na rozsah odberu zabezpečiť</p><p>príslušný typ produktu zvolený podľa predchádzajúcej vety Zmluvy,</p><p>zmluvné strany sa výslovne dohodli, že za záväzný sa bude považo-</p><p>vať ten typ produktu, ktorý je uvedený vo Výsledkoch spracovania.</p><p>RODIČKA súhlasí, že určenie produktu (rozsahu odberu) podľa tohto</p><p>bodu Zmluvy sa považuje za prejav jej vôle a v prípade, ak sa tým</p><p>mení rozsah plnení podľa Zmluvy, Zmluva sa týmto bude považovať</p><p>za zmenenú. Prípad podľa predchádzajúcej vety tvorí jedinú výnim-</p><p>ku, kedy sa na základe výslovnej dohody zmluvných strán nevyža-</p><p>duje na zmenu Zmluvy podpísanie dodatku k Zmluve. Predmetná</p><p>zmena rozsahu plnenia podľa Zmluvy sa následne premietne do</p><p>rozsahu práv a povinností zmluvných strán ako aj do výšky odplaty</p><p>a faktúry vystavenej zo strany CBC AG (napr. v prípade realizácie Pro-</p><p>duktu Štandard, napriek pôvodne v Zmluve označenému Produktu</p><p>Prémium, bude RODIČKE zo strany CBC AG fakturovaná platba za</p><p>Produkt Štandard). RODIČKA a Otec sa zaväzuje plniť všetky povin-</p><p>nosti, ktoré im vyplývajú z vyššie uvedenej zmeny Zmluvy.</p><p>Článok VI - Ďalšie zmluvné ustanovenia</p><p>VI.1</p><p>VI.2</p><p>CBC AG sa zaväzuje zabezpečovať plnenie predmetu Zmluvy pro-</p><p>stredníctvom riadne licencovaných subjektov v Slovenskej republi-</p><p>ke (najmä prostredníctvom S.R.P.K.B.) s tým, že za výsledok ich čin-</p><p>nosti zodpovedá akoby plnila sama.</p><p>V prípade poškodenia transplantátu do času jeho odovzdania na</p><p>skladovanie, keď medzi zavineným porušením povinností zo strany</p><p>CBC AG a spôsobenou škodou existuje priama príčinná súvislosť,</p><p>sa CBC AG zaväzuje nahradiť RODIČKE vzniknutú skutočnú škodu.</p><p>CBC AG predpokladá a predvída pri podpise tejto Zmluvy, že výška</p><p>škody môže byť maximálne vo výške odplaty zaplatenej RODIČKOU.</p><p>CBC AG nezodpovedá za škody vzniknuté na transplantáte, pokiaľ</p><p>nedošlo k zavineniu zo strany CBC AG ako aj v prípade poškodenia</p><p>zapríčineného tzv. vyššou mocou, napr. živelnou pohromou, vojnou</p><p>alebo inou udalosťou a pod., ktorej CBC AG nemohla zabrániť ani pri</p><p>vynaložení odbornej starostlivosti.</p><p>VI.3</p><p>Ak v dôsledku konania alebo nekonania RODIČKY alebo Otca v roz-</p><p>pore so Zmluvou nebude môcť CBC AG, resp. S.R.P.K.B. alebo iný</p><p>licencovaný subjekt v Slovenskej republike, prostredníctvom kto-</p><p>rého CBC AG plní Zmluvu, riadne a včas splniť niektorú zo svojich</p><p>povinností podľa Zmluvy, na základe výslovnej dohody zmluvných</p><p>strán sa má za to, že k splneniu týchto povinností vyplývajúcich zo</p><p>Zmluvy došlo riadne a včas. V takomto prípade dôjde bezodklad-</p><p>ne po odpadnutí prekážky brániacej v splnení Zmluvou uloženej</p><p>povinnosti k splneniu dotknutej povinnosti v rozsahu, spôsobom</p><p>a v lehote, v akej je pri vynaložení obvyklej odbornej starostlivosti</p><p>možné urobiť.</p><p>V.2</p><p>V prípade, ak bude RODIČKA alebo Otec v omeškaní s úhradou akej-</p><p>koľvek platby odplaty v zmysle bodu V.1 Zmluvy o 90 a viac kalen-</p><p>dárnych dní, a to aj napriek písomnej upomienke zaslanej RODIČKE</p><p>v rámci tejto lehoty, dohodli sa zmluvné strany, že RODIČKA nemá</p><p>VI.4</p><p>Ak RODIČKA neoznámi CBC AG zvolený Subjekt a čas prevzatia</p><p>transplantátu podľa Zmluvy v lehote do 6 mesiacov odo dňa do-</p><p>3</p><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><p><a id="br4"></a> </p><p>ručenia Výsledkov spracovania a ak sa zmluvné strany nedohodnú</p><p>inak (napríklad neuzatvoria Zmluvu o skladovaní), a to ani po pred-</p><p>chádzajúcej výzve CBC AG uskutočnenej v lehote 3 mesiacov odo VII.4</p><p>dňa doručenia Výsledkov spracovania, dohodli sa zmluvné strany, že</p><p>RODIČKA darováva transplantát S.R.P.K.B. na vedecké a medicínske</p><p>účely alebo S.R.P.K.B. je oprávnené zabezpečiť likvidáciu transplan-</p><p>tátu v súlade s príslušnými právnymi predpismi, s čím RODIČKA vý-</p><p>slovne súhlasí.</p><p>o zmene zmluvnej strany tejto Zmluvy v súlade s vyššie uvedenými</p><p>podmienkami.</p><p>Táto Zmluva sa uzatvára na dobu určitú, a to na dobu od podpisu</p><p>tejto Zmluvy až do momentu akceptácie transplantátu RODIČKOU.</p><p>Ostatné dojednania uvedené v tejto Zmluve tým nie sú dotknuté</p><p>(najmä v prípade odmietnutia pripraveného transplantátu RODIČ-</p><p>KOU, resp. aj Otcom, neplnenie ﬁnančných záväzkov voči CBC AG</p><p>a pod.). Zmluvu možno meniť a dopĺňať len na základe súhlasu obi-</p><p>dvoch zmluvných strán formou písomných dodatkov, s výslovným</p><p>odvolaním sa na Zmluvu, ak sa zmluvné strany výslovne nedohodnú</p><p>inak.</p><p>VI.5</p><p>VI.6</p><p>Pri prevzatí transplantátu Subjektom podpíšu CBC AG a RODIČKA</p><p>protokol o prevzatí transplantátu, v ktorom opíšu stav transplantá-</p><p>tu pri jeho prevzatí Subjektom a uvedú dátum prevzatia transplan-</p><p>tátu Subjektom. Od momentu prevzatia transplantátu Subjektom, VII.5</p><p>CBC AG nenesie žiadnu zodpovednosť za stav a použiteľnosť trans-</p><p>plantátu.</p><p>Ak sa akékoľvek ustanovenie tejto Zmluvy stane neplatným či ne-</p><p>vymáhateľným, nebude to mať vplyv na platnosť a vymáhateľnosť</p><p>ostatných ustanovení tejto Zmluvy. Zmluvné strany sa zaväzujú</p><p>nahradiť neplatné alebo nevymáhateľné ustanovenia novým usta-</p><p>novením, ktorého znenie bude zodpovedať úmyslu vyjadrenému</p><p>pôvodným ustanovením a touto Zmluvou ako celkom.</p><p>CBC AG nie je povinná zabezpečiť spôsobom podľa bodu IV.9 umož-</p><p>nenie prevzatia transplantátu Subjektom, resp. inou treťou osobou,</p><p>a to aj napriek tomu, že je riadne licencovaná, kým nie sú uhradené</p><p>všetky dlžné pohľadávky CBC AG voči RODIČKE. Týmto nie je do- VII.6</p><p>tknutá povinnosť CBC AG umožniť a zabezpečiť umožnenie prevza-</p><p>tia transplantátu príslušným zdravotníckym zariadením za účelom</p><p>jeho medicínskeho použitia na transplantáciu, s výnimkou prípadu</p><p>Zmluva nadobúda platnosť a účinnosť dňom jej podpísania oboma</p><p>zmluvnými stranami. Zmluva a vzťahy z nej vyplývajúce sa budú vy-</p><p>kladať a riadiť právnym poriadkom Slovenskej republiky.</p><p>VII.7 Zmluva je vyhotovená v dvoch exemplároch s platnosťou originálu,</p><p>pričom CBC AG obdrží jedno (1) vyhotovenie a RODIČKA a Otec spo-</p><p>ločne obdržia jedno (1) vyhotovenie.</p><p>kedy už došlo k jeho inému použitiu na vedecké a medicínske účely</p><p>príp. jeho likvidácii v súlade s príslušnými právnymi predpismi a/ale-</p><p>bo touto Zmluvou.</p><p>VII.8 Súčasťou Zmluvy je„Dotazník pre rodičku“,„Informácie pre rodičov“,</p><p>„</p><p>Informácia o spracúvaní osobných údajov dotknutej osoby“. Všetky</p><p>Článok VII - Záverečné ustanovenia</p><p>prílohy tejto Zmluvy tvoria jej neoddeliteľnú časť.</p><p>VII.1 Zmluvné strany sa dohodli, že v prípade smrti RODIČKY prechá-</p><p>dzajú všetky práva a povinnosti zo Zmluvy na dieťa narodené bez-</p><p>prostredne pred odberom krvi a/alebo tkaniva za účelom ich spra-</p><p>covania na transplantát. V prípade úmrtia Otca je RODIČKA povinná</p><p>v čo najkratšom čase vysporiadať príslušné práva a oznámiť CBC AG,</p><p>kto vstúpi do práv Otca vyplývajúcich zo Zmluvy. V prípade potreby</p><p>neodkladných úkonov vyzve CBC AG RODIČKU, aby ju informovala</p><p>o oprávnených subjektoch, ktorá tak je povinná urobiť obratom.</p><p>VII.2 V prípade zániku CBC AG bez právneho nástupcu sa CBC AG zaväzu-</p><p>je oznámiť bez zbytočného odkladu túto skutočnosť RODIČKE a na</p><p>základe písomného požiadania RODIČKY uskutočneného v lehote</p><p>do 12 mesiacov od doručenia vyššie uvedeného oznámenia zabez-</p><p>pečiť umožnenie prevzatia uskladneného transplantátu v súlade</p><p>s bodom IV.9 Zmluvy zo strany RODIČKY resp. Subjektu. V prípade,</p><p>ak RODIČKA nevyzve CBC AG na zabezpečenie umožnenia prevzatia</p><p>uskladneného transplantátu vo vyššie uvedenej lehote Subjektom,</p><p>RODIČKA týmto pre takýto prípad výslovne poveruje CBC AG, aby</p><p>zabezpečila likvidáciu transplantátu v súlade s príslušnými právnymi</p><p>predpismi.</p><p>VII.3 Zmluvné strany sa dohodli, že CBC AG je oprávnená kedykoľvek po-</p><p>stúpiť (previesť) svoje práva a povinnosti v zmysle tejto Zmluvy na</p><p>inú entitu a táto iná entita je oprávnená prevziať povinnosti CBC AG</p><p>vyplývajúce jej z tejto Zmluvy ak, (i) je táto entita členom skupiny</p><p>CBC, (ii) má materiálno-technické zabezpečenie k plneniu povin-</p><p>ností CBC AG v zmysle tejto Zmluvy, (iii) nebol voči nej vyhlásený</p><p>konkurz alebo schválená reštrukturalizácia, (iv) nie je v predĺžení ani</p><p>v likvidácii (ďalej len „Postúpenie“). V prípade potreby sa RODIČKA</p><p>s Otcom zaväzujú vykonať akýkoľvek úkon, vrátane ale nie výlučne,</p><p>podpísania súhlasu alebo dodatku, na základe ktorého dôjde k po-</p><p>tvrdeniu účinného Postúpenia. CBC AG sa zaväzuje bez zbytočného</p><p>odkladu informovať RODIČKU a Otca o Postúpení. Zmluvné strany</p><p>budú považovať Postúpenie taktiež za dohodu zmluvných strán</p><p>VII.9 Ak počas pôrodu bude odobratých menej ako 20 mililitrov krvi a/</p><p>alebo tkanivo nebude odobraté v súlade so schváleným štandard-</p><p>ným pracovným postupom a ak sa zmluvné strany nedohodnú</p><p>inak, má sa za to, že RODIČKA nemá záujem o spracovanie krvi a/</p><p>alebo tkaniva. V takom prípade CBC AG nebude ďalej zabezpečo-</p><p>vať následné plnenie podľa tejto Zmluvy, a teda S.R.P.K.B. nepoužije</p><p>odobratú krv a/alebo tkanivo na prípravu transplantátu a ani nevy-</p><p>staví a neposkytne RODIČKE Výsledky spracovania. V tomto prípade,</p><p>zmluvné strany súhlasia, že krv a/alebo tkanivo sa bude považovať</p><p>za darovanú/é S.R.P.K.B., a to na účely jej/ich likvidácie v súlade s prí-</p><p>slušnými právnymi predpismi.</p><p>VII.10 RODIČKA je povinná CBC AG bezodkladne oznámiť akúkoľvek zme-</p><p>nu svojej adresy alebo akýchkoľvek iných údajov. V prípade, ak CBC</p><p>AG zašle akúkoľvek písomnosť na adresu RODIČKY uvedenú v záhla-</p><p>ví Zmluvy, alebo na poslednú oznámenú adresu RODIČKY, považuje</p><p>sa takáto písomnosť za doručenú siedmym pracovným dňom po jej</p><p>podaní na poštovú prepravu.</p><p>VII.11 Otec podpisom tejto Zmluvy vyjadruje svoj výslovný súhlas s tým,</p><p>aby všetky práva resp. povinnosti súvisiace s plnením tejto Zmluvy</p><p>patriace Otcovi vykonávala resp. plnila v Otcovom mene RODIČKA,</p><p>na čo jej podpisom tejto Zmluvy udeľuje plnomocenstvo, okrem</p><p>prípadov, kedy je v tejto Zmluve uvedené, že sa vyžaduje aj súhlas</p><p>Otca. Otec zároveň súhlasí s tým, aby boli všetky písomnosti podľa</p><p>tejto Zmluvy adresované RODIČKE alebo Otcovi zasielané len RO-</p><p>DIČKE. RODIČKA sa podpisom tejto Zmluvy zaväzuje informovať</p><p>Otca o doručení písomností a ich obsahu. Nárok Otca na náhradu</p><p>škody voči RODIČKE týmto nie je dotknutý. Ak bude nutné, aby Otec</p><p>podľa tejto Zmluvy niečo osobne konal alebo strpel, zaväzuje sa</p><p>potrebné úkony vykonať alebo strpieť on sám. V prípade, že Otec</p><p>nebude účastníkom tejto Zmluvy, všetky práva a povinnosti Otca</p><p>vyplývajúce z tejto Zmluvy bude vykonávať výlučne RODIČKA.</p><p>V Bratislave dňa ........................................................................</p><p>V..................................................... dňa .........................................</p><p>.</p><p>.......................................................................................................</p><p>..........................................................................................................</p><p>(RODIČKA)</p><p>za CBC AG</p><p>Ján Šidlík, MBA</p><p>(splnomocnenec)</p><p>.</p><p>.........................................................................................................</p><p>(Otec)</p><p>CBCAG-ZDLMO-V003-P080322</p><p>4</p><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," /><img src="data:image/jpeg;base64," />');
